import React from'react';
import './'





const Field= () => {
    return(
        <form action="#">
        <label class='text-field'>
          <input name="email-example" type="text" class="text-field__input" placeholder="Enter your E-Mail"/>
          <span class="text-field__label">
            E-Mail
          </span>
        </label>
      </form>
    );
}

export default Field;
